import axios from "axios";
import { useEffect, useState } from "react";
import "./Tracks.css";

function Tracks() {
  const [cards, setCards] = useState([]);

  const getData = async () => {
    const data = await axios({
      method: "get",
      url: "http://localhost:8000/cards",
    });
    setCards(data.data);
  };

  useEffect(() => {
    getData();

  }, []);

  return (
    <>
    {
      cards.map(obj => {
              return  <h3>{obj.title}</h3>
      })
    }
    </>
  );
}

export default Tracks;
